        require(mintOpen, "Minting is not yet open for public!");
        _;
    }

    // @notice - Mint NFT
    // @dev - paid minting
    function mint(uint256 _amount)
        external
        payable
        whenMintIsOpen
    {
        require(totalSupply() + _amount <= maxSupply, "Can't exceed max supply!");
        require(balanceOf(msg.sender) + _amount < maxPerWallet, "One wallet can't mint more than max allowed NFTs");
        require(!minted[msg.sender], "Error: This wallet has already minted its quota of max allowed NFTs.");
        require(msg.value == mintPrice * _amount, "Must pay mint fee!");

        if(balanceOf(msg.sender) + _amount == maxPerWallet) {
            minted[msg.sender] = true;
        }
        payable(address(this)).transfer(msg.value);
        _safeMint(msg.sender, _amount);
    }

